import React from 'react';
import PropTypes from 'prop-types';
import Todo from './Todo';
import './TodoList.css'

const TodoList = ({ todos, toggleTodo }) => (
  <ul className="todo-list">
    {todos.map((todo) => (
      <Todo
        key={todo.id}
        {...todo}
        onClick={() => toggleTodo(todo.id)}
      />
    ))}
  </ul>
);


export default TodoList;
